import React from 'react';

const OcjenaRow = ({ id, ucenik, nastavnik, datum, ocjena, razred }) => {
  return (
    <div>
      <p>
        {id} {ucenik} {nastavnik} {datum} {ocjena} {razred}
      </p>
    </div>
  );
};

export default OcjenaRow;
